import React, { Component }from "react";
import Footer from "./component/footer";
import Header from "./component/header";
import Item from "./component/Item";
import List from "./component/list";
class App extends Component{
  render(){
    return(
      <div>
       <Header/>
       <List/>
       <Item/>
       <Footer/>
      </div>
    )
  }
}
export default App;
